import styled from "styled-components";

export const Container = styled.div`
  #detalhe_comerciante_1 {
    right: 0;
    top: 0;
    position: absolute;
  }
  #detalhe_comerciante_2 {
    right: -2px;
    top: 933px;
    position: absolute;
    width: 526px;
    height: 345px;
    object-fit: cover;
    object-position: 20px 10px;
  }
  #detalhe_comerciante_3 {
    right: 77px;
    top: 52px;
    position: absolute;
  }
  #ball_157px {
    top: 137px;
    right: 576px;
    width: 157px;
    height: 157px;
  }
  #ball_227px {
    width: 227px;
    height: 227px;
    right: 672px;
    top: 875px;
  }
  #ball_106px {
    width: 106px;
    height: 106px;
    left: -25px;
    top: 601px;
  }
  .gg_face_comerciante_div {
    background: #fff;
    .ball_white_ {
      border: 0;
    }
    p {
      color: #26768d;
    }
  }
  /*STYLED COMPONENTS  */
  section {
    #button_login_cadastro {
      background: #fff;
      margin: 47px 0 0 104px;
      #marcador {
        background: #26768d;
        p {
          color: #fff;
        }
      }
      .botton_white {
        color: #000;
      }
    }
    #cadastro {
      float: left;
      margin: 58px 0 0 105px;
      ul {
        #hr {
          hr {
            background-color: #fff;
          }
          color: #fff;
        }
      }
      a {
        color: #fff;
      }
      li {
        input {
          border: 3px solid #fff;
          background-color: #26768d;
          color: #fff;
        }
        p {
          color: #fff;
        }
      }
    }
  }
`;
